import React, { Component } from 'react';
import { Nav, Navbar, Button } from 'react-bootstrap';
import LoginButton from 'components/UI/LoginButton/LoginButton';
import 'components/Navigation/Navigation.css';
import spotifyWebApi from 'App';

class Navigation extends Component{

    getDisplayName() {
        spotifyWebApi.getMe()
          .then((response) => {
            console.log(response);
            this.setState({
              displayName: response.display_name
            })
          })
      }

      componentDidMount () {

      }

    render(){
        return(
 <Navbar className="navigationBar" expand="lg" fixed="top">
         <Navbar.Brand href="#">
                 <div className="logo-text">re-set</div>
    </Navbar.Brand>
    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="items">
            <Nav.Item className="nav-item"><Nav.Link href="/"><span className="nav-hover">Home</span></Nav.Link></Nav.Item>
            <Nav.Item className="nav-item"><Nav.Link href="/"><span className="nav-hover">About</span></Nav.Link></Nav.Item>
            <Nav.Item className="nav-item"><Nav.Link href="/"><span className="nav-hover">Contact</span></Nav.Link></Nav.Item>
        </Nav>
        <LoginButton loggedIn={this.loggedIn}/>
        </Navbar.Collapse>
    </Navbar>
        );
    }
}

export default Navigation;
